import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import './App.css';
import HomePage from './component/HomePage';
import LoginTypeSelection from './component/LoginTypeSelection';
import LoginPage from './component/LoginPage';
// Import other necessary components like LoginPage for different user roles

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<HomePage />} />
        <Route path="/login" element={<LoginTypeSelection />} />
        <Route path="/login/superadmin" element={<LoginPage />} />
        {/* Add more Route components for other user role login paths here */}
      </Routes>
    </Router>
  );
}

export default App;
